---------------------------------------------------------------------------------------------------------
-- Table: LOC.CITIES
---------------------------------------------------------------------------------------------------------

CREATE TABLE LOC.CITIES (
	CITY_ID				INT NOT NULL,				 -- Unique City Identifier
	CITY_NAME			VARCHAR2(250) NOT NULL,      -- Name of cities
	STATE_ID			INT	NOT NULL,				 -- foreign staties
	CODE				INT                          -- identifier code provided by federal agencies of each country. 
);

-- CONSTRAINTS

ALTER TABLE LOC.CITIES
	ADD CONSTRAINT PK001_CITIES PRIMARY KEY (CITY_ID);
	
ALTER TABLE LOC.CITIES
	ADD CONSTRAINT FK001_CITIES_TO_STATIES FOREIGN KEY (STATE_ID) REFERENCES LOC.STATIES (CITY_ID);


-- SEQUENCES.

CREATE SEQUENCE SQ001_CITIES MINVALUE 1 MAXVALUE 999999999999999999999999999 START WITH 1 INCREMENT BY 1 CACHE 20;

